import styled from "styled-components";
import { Link } from "react-router-dom";
import eventicon from "../img/eventicon.png";
import infoicon from "../img/infoicon.png";

const FooterConatiner = styled.div`
  display: flex;
  justify-content: space-evenly;
  align-items: center;
  position: absolute;
  width: 100%;
  height: 12rem;
  background-color: var(--cream);
  bottom: 0;
  border: 1px solid var(--border);
  box-sizing: border-box;
`;

const Menus = styled.ul`
  display: flex;
  justify-content: space-evenly;
  min-width: 10rem;
`;
const Menu = styled.li`
  font-size: 1.5rem;
  font-weight: 400;
  margin-right: 1.5rem;
  list-style: none;
  &:nth-child(2) {
    width: 15rem;
  }
`;
const Icon = styled.img`
  width: 150px;
  height: 150px;
`;

function Footer() {
  return (
    <FooterConatiner>
      <Menus>
        <Menu>
          <Link to={"/club_info"}>
            <Icon src={infoicon}> /</Icon>
          </Link>
        </Menu>
        <Menu></Menu>
        <Menu>
          <Link to={"/event"}>
            <Icon src={eventicon} />
          </Link>
        </Menu>
      </Menus>
    </FooterConatiner>
  );
}

export default Footer;
